def isprime(n):
    if n <= 1:
        return False
    if n <= 3:
        return True
    if n % 2 == 0 or n % 3 == 0:
        return False
    i = 5
    while i * i <= n:
        if n % i == 0 or n % (i + 2) == 0:
            return False
        i = i + 6
    return True


def factor(n):
    l = []
    for i in range(2, int(n ** 0.5) + 1):
        if n % i == 0:
            l.append(i)
            if i != n // i:
                l.append(n // i)
    return l


def ncr(n, r):
    if n < r:
        return 0
    elif n - r < r:
        return 1
    else:
        numer = factor(n)
        denominators = factor(r)
        return numer[0] / denominators[0] ** (n - r) * \
            denominators[1] ** r


