    def majorityElement(self, nums):
        """
         :type nums: List[int]
         :rtype: List[int]
         """
        if not nums:
            return []
        count = 0
        candidate = None
        for num in nums:
            if count == 0:
                candidate = num
            count += (1 if num == candidate else -1)
        return [num for num in nums if num == candidate]

