def solve(n, m, k, maze):
    q = deque()
    q.append((0, 0, 0, 0))
    visited = {(0, 0)}
    while len(q) > 0:
        x, y, dx, dy = q.popleft()
        if maze[x][y] == '*':
            return 'IMPOSSIBLE'
        if maze[x][y] == 'X':
            return maze[x][y]
        for dx, dy in [(0, 1), (0, -1), (1, 0), (-1, 0)]:
            nx, ny = x + dx, y + dy
            if 0 <= nx < n and 0 <= ny < m and maze[nx][ny] != '*':
                if (nx, ny, dx, dy) not in visited:
                    q.append((nx, ny, dx, dy))
                    visited.add((nx, ny, dx, dy))
    return maze


