def digit_product(n):
    if n == 1:
        return 9
    digits = [int(d) for d in str(n)]
    digits = [d for d in digits if d != 0]
    if len(digits) == 1:
        return 9
    @lru_cache(maxsize=None)
    def f(n):
        if n == 1:
            return 9
        digits = [int(d) for d in str(n)]
        digits = [d for d in digits if d != 0]
        if len(digits) == 1:
            return 9
        if n % 10 == digits[0]:
            return f(n // 10) + 1
        else:
            return f(n // 10) + 1 + sum(f(d) for d in digits[1:])
    return f(n)


