class BIT:

    def __init__(self, n):
        self.size = n
        self.tree = [0] * (n + 1)

    def add(self, i, x):
        while i <= self.size:
            self.tree[i] = self.tree[i] + x
            i = i + (i & -i)

    def get(self, i):
        return self.tree[i] + self.tree[i - 1]

    def query(self, i, j):
        s = 0
        while i <= j:
            if i & 1:
                s = s + self.tree[i]
                i = i + 1
            if j & 1:
                j -= 1
                s = s + self.tree[j]
            i = i // 2
        return s

    def range_query(self, i, j):
        return self.get(j) - self.get(i - 1)


