def word_ladder(start, end, dict):
    queue = deque([(start, 0)])
    visited = {start}
    while queue:
        word, steps = queue.popleft()
        if word == end:
            return word, steps
        for i in range(len(word)):
            for c in 'abcdefghijklmnopqrstuvwxyz':
                if word[i] != c and word[i] + c not in visited:
                    queue.append((word[:i] + c + word[i + 1:], steps + 1))
                    visited.add(word[:i] + c + word[i + 1:])
    return 0, -1


